const Navbar = () => {
    return (
        <>
            <div>
                    <NavLink to="/Camera" activeStyle>
                    Camera
                    </NavLink>
                    <NavLink to="/User" activeStyle>
                    User
                    </NavLink>
            </div>
        </>
    );
};

export default Navbar;
